import { Typography } from "@mui/material"
import { Stack, Button } from "@mui/material"
//import LoginIcon from "@mui/material/Login"


export const MuiTypography = () => {
    return (
        <div>
            <Typography variant="h1" fontFamily="Arial">Hallo Steffi</Typography>
            <Typography variant="body1" fontFamily="Roboto"> Hallo Steffi dies ist der erste Versuch einer Website.
            Denn das Zeug das Mathis uns empfolen hat verstehe ich selber nicht, aber ich habe mal ein wenig damit herumgespielt</Typography>
            <Typography variant="body1" fontFamily="Calibri"> Es folgt der selbe Text, aber in einer anderen Schriftart</Typography>
            <Typography variant="body1" fontFamily="Courier"> Hallo Steffi dies ist der erste Versuch einer Website.
            Denn das Zeug das Mathis uns empfolen hat verstehe ich selber nicht, aber ich habe mal ein wenig damit herumgespielt</Typography>
        </div>
    )
}

export const MuiButton = () => {
    return (
        <Stack spacing={4}>
            <Stack spacing={2} direction="row">
                <Button variant="text" color= "success"> Ein Button ohne Rand </Button>
                <Button variant="contained" color= "success"> Ein Button ausgef√ºllt </Button>
                <Button variant="outlined" href="http://google.com" color= "success"> Ein Button nur mit Rand </Button>
            </Stack>
            {/* <Stack spacing={2} direction="row">
                <Button variant="contained" color= "success" startIcon={<LoginIcon />}>LogIn</Button>
            </Stack> */}
        </Stack>

        
    )
}
